('con', 'ans'),
('con', 'ans'),
('What is a coronavirus?', 'Coronaviruses are a large family of viruses which may cause illness in animals or humans.?'),
('What is a coronavirus?', 'In humans, several coronaviruses are known to cause respiratory infections ranging from the common cold to more severe diseases'),
('What is Covid-19?', 'Covid-19 is the infectious disease caused by the most recently discovered coronavirus. This new virus and disease were unknown before the outbreak began in Wuhan, China, in December 2019.'),
('What are the symptoms of Covid-19?', 'The most common symptoms of Covid-19 are fever, tiredness, and dry cough. Some patients may have aches and pains, nasal congestion, runny nose, sore throat or diarrhea. These symptoms are usually mild and begin gradually.'),
('What are the symptoms of Covid-19?', 'Some people become infected but don?t develop any symptoms and don\'t feel unwell. Most people (about 80%) recover from the disease without needing special treatment.'),
('What are the symptoms of Covid-19?', 'Around 1 out of every 6 people who gets Covid-19 becomes seriously ill and develops difficulty breathing.?'),
('What are the symptoms of Covid-19?', 'Older people, and those with underlying medical problems like high blood pressure, heart problems or diabetes, are more likely to develop serious illness. People with fever, cough and difficulty breathing should seek medical attention.'),
('How does Covid-19 spread?', 'People can catch Covid-19 from others who have the virus. The disease can spread from person to person through small droplets from the nose or mouth which are spread when a person with Covid-19 coughs or exhales.?'),
('How does Covid-19 spread?', 'People can also catch Covid-19 if they breathe in droplets from a person with Covid-19 who coughs out or exhales droplets. This is why it is important to stay more than 1 meter (3 feet) away from a person who is sick.'),
('Can the virus that causes Covid-19 be transmitted through the air?', 'Studies to date suggest that the virus that causes Covid-19 is mainly transmitted through contact with respiratory droplets rather than through the air.?'),
('Can Covid-19 be caught from a person who has no symptoms?', 'The main way the disease spreads is through respiratory droplets expelled by someone who is coughing. The risk of catching Covid-19 from someone with no symptoms at all is very low.'),
('Can Covid-19 be caught from a person who has no symptoms?', 'Many people with Covid-19 experience only mild symptoms. This is particularly true at the early stages of the disease. It is therefore possible to catch Covid-19 from someone who has, for example, just a mild cough and does not feel ill. '),
('Can I catch Covid-19 from the feces of someone with the disease?', 'The risk of catching Covid-19 from the feces of an infected person appears to be low. While initial investigations suggest the virus may be present in feces in some cases, spread through this route is not a main feature of the outbreak. '),
('What can I do to protect myself and prevent the spread of disease?', 'Regularly and thoroughly clean your hands with an alcohol-based hand rub or wash them with soap and water.'),
('What can I do to protect myself and prevent the spread of disease?', 'Maintain at least 1 metre (3 feet) distance between yourself and anyone who is coughing or sneezing.'),
('What can I do to protect myself and prevent the spread of disease?', 'Avoid touching eyes, nose and mouth.'),
('What can I do to protect myself and prevent the spread of disease?', 'Make sure you, and the people around you, follow good respiratory hygiene. This means covering your mouth and nose with your bent elbow or tissue when you cough or sneeze. Then dispose of the used tissue immediately.'),
('What can I do to protect myself and prevent the spread of disease?', 'Stay home if you feel unwell. If you have a fever, cough and difficulty breathing, seek medical attention and call in advance. Follow the directions of your local health authority.'),
('What can I do to protect myself and prevent the spread of disease?', 'If possible, avoid traveling to places ?? especially if you are an older person or have diabetes, heart or lung disease.'),
('What can I do to protect myself and prevent the spread of disease?', 'Keep up to date on the latest Covid-19 hotspots (cities or local areas where Covid-19 is spreading widely).'),
('What can I do to protect myself andProtection measures for persons who are in or have recently visited (past 14 days) areas where Covid-19 is spreading prevent the spread of disease?', 'Self-isolate by staying at home if you begin to feel unwell, even with mild symptoms such as headache, low grade fever (37.3 C or above) and slight runny nose, until you recover.'),
('Protection measures for persons who are in or have recently visited (past 14 days) areas where Covid-19 is spreading?', 'If you develop fever, cough and difficulty breathing, seek medical advice promptly as this may be due to a respiratory infection or other serious condition. Call in advance and tell your provider of any recent travel or contact with travelers.'),
('How likely am I to catch Covid-19?', 'The risk depends on where you ?are - and more specifically, whether there is a Covid-19 outbreak unfolding there.'),
('How likely am I to catch Covid-19?', 'For most people in most locations the risk of catching Covid-19 is still low. However, there are now places around the world (cities or areas) where the disease is spreading. For people living in, or visiting, these areas the risk of catching Covid-19 is higher.'),
('How likely am I to catch Covid-19?', 'Covid-19 outbreaks can be contained and transmission stopped, as has been shown in China and some other countries. Unfortunately, new outbreaks can emerge rapidly. It?s important to be aware of the situation where you are or intend to go.'),
('Should I worry about Covid-19?', 'Illness due to Covid-19 infection is generally mild, especially for children and young adults. However, it can cause serious illness: about 1 in every 5 people who catch it need hospital care.'),
('Should I worry about Covid-19?', 'We can channel our concerns into actions to protect ourselves, our loved ones and our communities.'),
('Who is at risk of developing severe illness?', 'While we are still learning about how Covid-2019 affects people, older persons and persons with pre-existing medical conditions (such as high blood pressure, heart disease, lung disease, cancer or diabetes)  appear to develop serious illness more often than others. '),
('Are antibiotics effective in preventing or treating the Covid-19?', 'No. Antibiotics do not work against viruses, they only work on bacterial infections. Covid-19 is caused by a virus, so antibiotics do not work.?'),
('Are antibiotics effective in preventing or treating the Covid-19?', 'Antibiotics should not be used as a means of prevention or treatment of Covid-19. They should only be used as directed by a physician to treat a bacterial infection.?'),
('Are there any medicines or therapies that can prevent or cure Covid-19?', 'While some western, traditional or home remedies may provide comfort and alleviate symptoms of Covid-19, there is no evidence that current medicine can prevent or cure the disease.?'),
('Are there any medicines or therapies that can prevent or cure Covid-19?', 'WHO does not recommend self-medication with any medicines, including antibiotics, as a prevention or cure for Covid-19.'),
('Is there a vaccine, drug or treatment for Covid-19?', 'Not yet. To date, there is no vaccine and no specific antiviral medicine to prevent or treat Covid-2019.?'),
('Is there a vaccine, drug or treatment for Covid-19?', 'Those affected should receive care to relieve symptoms. People with serious illness should be hospitalized. Most patients recover thanks to supportive care.'),
('Is there a vaccine, drug or treatment for Covid-19?', 'Possible vaccines and some specific drug treatments are under investigation. They are being tested through clinical trials. WHO is coordinating efforts to develop vaccines and medicines to prevent and treat Covid-19.'),
('Is there a vaccine, drug or treatment for Covid-19?', 'The most effective ways to protect yourself and others against Covid-19 are to frequently clean your hands, cover your cough with the bend of elbow or tissue, and maintain a distance of at least 1 meter (3 feet) from people who are coughing or sneezing.'),
('Is Covid-19 the same as SARS?', 'No. The virus that causes Covid-19 and the one that caused the outbreak of Severe Acute Respiratory Syndrome (SARS) in 2003 are related to each other genetically, but the diseases they cause are quite different.'),
('Is Covid-19 the same as SARS?', 'SARS was more deadly but much less infectious than Covid-19. There have been no outbreaks of SARS anywhere in the world since 2003.'),
('Should I wear a mask to protect myself?', 'Only wear a mask if you are ill with Covid-19 symptoms (especially coughing) or looking after someone who may have Covid-19. Disposable face mask can only be used once.'),
('Should I wear a mask to protect myself?', 'If you are not ill or looking after someone who is ill then you are wasting a mask.?'),
('Should I wear a mask to protect myself?', 'There is a world-wide shortage of masks, so WHO urges people to use masks wisely.'),
('How to put on, use, take off and dispose of a mask?', 'Remember, a mask should only be used by health workers, care takers, and individuals with respiratory symptoms, such as fever and cough.'),
('How to put on, use, take off and dispose of a mask?', 'Before touching the mask, clean hands with an alcohol-based hand rub or soap and water'),
('How long is the incubation period for Covid-19?', 'The ?incubation period? means the time between catching the virus and beginning to have symptoms of the disease.'),
('How long is the incubation period for Covid-19?', 'Most estimates of the incubation period for Covid-19 range from 1-14 days, most commonly around five days. These estimates will be updated as more data become available.'),
('Can humans be infected with the Covid-19 from an animal source?', 'Coronaviruses are a large family of viruses that are common in animals. Occasionally, people get infected with these viruses which may then spread to other people.'),
('Can humans be infected with the Covid-19 from an animal source?', 'SARS-CoV was associated with civet cats and MERS-CoV is transmitted by dromedary camels. '),
('Can humans be infected with the Covid-19 from an animal source?', 'Possible animal sources of Covid-19 have not yet been confirmed. ?'),
('Can humans be infected with the Covid-19 from an animal source?', 'To protect yourself, such as when visiting live animal markets, avoid direct contact with animals and surfaces in contact with animals.'),
('Can humans be infected with the Covid-19 from an animal source?', 'Handle raw meat, milk or animal organs with care to avoid contamination of uncooked foods and avoid consuming raw or undercooked animal products.'),
('Can I catch Covid-19 from my pet?', 'While there has been?one instance of a dog being infected in Hong Kong, to?date, there is no evidence that a dog, cat or any pet can transmit Covid-19.'),
('Can I catch Covid-19 from my pet?', 'Covid-19 is mainly spread through droplets produced when an infected person coughs, sneezes, or speaks.'),
('How long does the virus survive on surfaces?', 'It is not certain how long the virus that causes Covid-19 survives on surfaces, but it seems to behave like other coronaviruses.'),
('How long does the virus survive on surfaces?', 'Studies suggest that coronaviruses (including preliminary information on the Covid-19 virus) may persist on surfaces for a few hours or up to several days. This may vary under different conditions (e.g. type of surface, temperature or humidity of the environment).'),
('How long does the virus survive on surfaces?', 'If you think a surface may be infected, clean it with simple disinfectant to kill the virus and protect yourself and others.'),
('Is it safe to receive a package from any area where Covid-19 has been reported?', 'Yes. The likelihood of an infected person contaminating commercial goods is low and the risk of catching the virus that causes Covid-19 from a package that has been moved, travelled, and exposed to different conditions and temperature is also low.?'),
('Is there anything I should not do?', 'Smoking'),
('Is there anything I should not do?', 'Wearing multiple masks'),
('Is there anything I should not do?', 'Taking antibiotics'),
('Is the source causing Covid-19 known?', 'Currently, the source of SARS-CoV-2, the coronavirus (CoV) causing Covid-19 is unknown.'),
('How did the first human SARS-CoV-2 infections occur?', 'The first human cases of Covid-19 were identified in Wuhan City, China in December 2019.'),
('How did the first human SARS-CoV-2 infections occur?', 'SARS-CoV, the virus which caused the SARS outbreak in 2003, jumped from an animal reservoir (civet cats, a farmed wild animal) to humans and then spread between humans.?'),
('How did the first human SARS-CoV-2 infections occur?', 'Until the source of this virus is identified and controlled, there is a risk of reintroduction of the virus in the human population and the risk of new outbreaks like the ones we are currently experiencing.'),
('Is Covid-19 airborne?', 'The virus that causes Covid-19 is mainly transmitted through droplets generated when an infected person coughs, sneezes, or speaks. These droplets are too heavy to hang in the air. They quickly fall on floors or surfaces. '),
('Are pregnant women at higher risk from Covid-19?', 'At present there is no evidence that they are at higher risk of severe illness than the general population.'),
('Are pregnant women at higher risk from Covid-19?', 'due to changes in their bodies and immune systems, we know that pregnant women can be badly affected by some respiratory infections. It is therefore important that they take precautions to protect themselves against Covid-19, and report possible symptoms (including fever, cough or difficulty breathing) to their healthcare provider.'),
('I\'m pregnant. How can I protect myself against Covid-19?', 'Pregnant women should take the same precautions to avoid Covid-19 infection as other people.'),
('I\'m pregnant. How can I protect myself against Covid-19?', 'Pregnant women and women who have recently delivered ? including those affected by Covid-19 - should attend their routine care appointments.?'),
('Should pregnant women be tested for Covid-19?', 'Testing protocols and eligibility vary depending on where you live.'),
('Can Covid-19 be passed from a woman to her unborn baby?', 'We still do not know if a pregnant woman with Covid-19 can pass the virus to her foetus or baby during pregnancy or delivery. To date, the virus has not been found in samples of amniotic fluid or breastmilk.'),
('What care should be available during pregnancy and childbirth?', 'All pregnant women, including those with confirmed or suspected Covid-19 infections, have the right to high quality care before, during and after childbirth.?'),
('Do pregnant women with suspected or confirmed Covid-19 need to give birth by ceasarean section?', 'No. WHO advice is that caesarean sections should only be performed when medically justified.'),
('Can women with Covid-19 breastfeed?', 'Yes. Women with Covid-19 can breastfeed if they wish to do so.'),
('Can I touch and hold my newborn baby if I have Covid-19?', 'Yes. Close contact and early, exclusive breastfeeding helps a baby to thrive. '),
('How are Covid-19 and influenza viruses similar?', 'Covid-19 and influenza viruses have a similar disease presentation. That is, they both cause respiratory disease, which presents as a wide range of illness from asymptomatic or mild through to severe disease and death.'),
('How are Covid-19 and influenza viruses similar?', 'Both viruses are transmitted by contact, droplets and fomites.'),
('How are Covid-19 and influenza viruses different?', 'The speed of transmission is an important point of difference between the two viruses. Influenza has a shorter median incubation period (the time from infection to appearance of symptoms) and a shorter serial interval (the time between successive cases) than Covid-19 virus.'),
('How are Covid-19 and influenza viruses different?', 'Those most at risk for severe influenza infection are children, pregnant women, elderly, those with underlying chronic medical conditions and those who are immunosuppressed.'),
('How are Covid-19 and influenza viruses different?', 'Mortality for Covid-19 appears higher than for influenza, especially seasonal influenza.'),
('What medical interventions are available for Covid-19 and influenza viruses?', 'While there are a number of therapeutics currently in clinical trials in China and more than 20 vaccines in development for Covid-19, there are currently no licensed vaccines or therapeutics for Covid-19.'),
('Are smokers and tobacco users at higher risk of Covid-19 infection?', 'Smokers are likely to be more vulnerable to Covid-19 as the act of smoking means that fingers (and possibly contaminated cigarettes) are in contact with lips which increases the possibility of transmission of virus from hand to mouth.'),
('Are smokers and tobacco users at higher risk of Covid-19 infection?', 'Smoking products such as water pipes often involve the sharing of mouth pieces and hoses, which could facilitate the transmission of Covid-19 in communal and social settings.'),
('How large does a meeting or event need to be in order to be a ?mass gathering??', 'High profile international sporting events such as the Olympics or World Cups as well as international religious events such as the Hajj count as mass gatherings.'),
('How large does a meeting or event need to be in order to be a ?mass gathering??', 'An event counts as a ?mass gatherings? if the number of people it brings together is so large that it has the potential to strain the planning and response resources of the health system in the community where it takes place.?'),
('Does WHO recommend that all international mass gatherings be cancelled because of Covid-19?', 'No. As each international mass gathering is different, the factors to consider when determining if the event should be cancelled may also differ.?');
